export function getOneDriveSdsLink(chemicalName: string): string {
  const key = chemicalName.toLowerCase().replace(/[^a-z0-9]+/g, '-').replace(/^-|-$/g, '');
  return ONEDRIVE_SDS_LINKS[key] || ONEDRIVE_SDS_LINKS['__DEFAULT__'];
}
